import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';  // Import necessary components from React Router
import Page1 from './Page1';  // Import the new page components
import Page2 from './Page2';

export default function App() {
  return (
    <Router>
      <div className="App">
        <h1>Quantify</h1>

        <nav>
          {/* Navigation buttons */}
          <Link to="/page1">
            <button>Go to Page 1</button>
          </Link>
          <Link to="/page2">
            <button>Go to Page 2</button>
          </Link>
        </nav>

        <Routes>
          {/* Define routes */}
          <Route path="/page1" element={<Page1 />} />
          <Route path="/page2" element={<Page2 />} />
          {/* You can add more routes here */}
        </Routes>

        <footer className="App-footer">
          <p>By: Tracey Lin, Eileen Lin, Peter Dong, Nazar Korniichuk</p>
        </footer>
      </div>
    </Router>
  );
}
